import React from 'react';


const Home = () => {
    return (
        <div className='homePageWrapper'>
            <div className="formWrapper">
                <img
                    className="homePageLogo"
                    src="/logo.png"
                    alt="logo"
                />
                <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Sofia"></link>
                <h1 className="homePageSlogan">Let's Collab</h1>
                <h4 className="mainLabel">Paste Invitation ROOM ID</h4>
                <div className="inputGroup">
                    <input
                        type="text"
                        className="inputBox"
                        placeholder="ROOM ID"
                        //onChange={(e) => setRoomId(e.target.value)}
                        //value={roomId}
                        //onKeyUp={handleInputEnter}
                    />
                    <input
                        type="text"
                        className="inputBox"
                        placeholder="USERNAME"
                        //onChange={(e) => setRoomId(e.target.value)}
                        //value={roomId}
                        //onKeyUp={handleInputEnter}
                    />     
                    <button className="btn joinBtn">
                            Join
                    </button>
                    <span className="createInfo">
                        If you don't have an invitation then create &nbsp;
                        <a href="" className="createNewBtn">
                            new room
                        </a>
                    </span>
                </div>
            </div>

            <footer>
                <h4>
                    Built by <a href='https://trailblazer.me/id/akaushal26'>AB‚ù§Kaushal</a>
                </h4>
            </footer>
        </div>
        
    );
};
export default Home;
